css:
.github-Accordion {
  cursor: default;
  user-select: none;
}
.github-Accordion-header {
  font-weight: 600;
  color: rgba(153, 178, 184, 0.6);
  padding: 5px;
  border-bottom: 1px solid #001a20;
}
.github-Accordion-header::-webkit-details-marker {
  color: rgba(153, 178, 184, 0.6);
}
.github-Accordion-content {
  border-bottom: 1px solid #001a20;
  background-color: #002b36;
}
.github-Accordion-content:empty::before {
  content: "Empty";
  display: block;
  font-style: italic;
  text-align: center;
  color: rgba(153, 178, 184, 0.6);
}
.github-Accordion-list {
  margin: 0;
  padding: 0;
  list-style: none;
}
.github-Accordion[open] .github-Accordion-header {
  color: #d5dfe2;
}
.github-Accordion-listItem {
  display: flex;
  align-items: center;
  padding: 2.5px;
  border-bottom: 1px solid #001a20;
}
.github-Accordion-listItem:last-child {
  border: none;
}
.github-Accordion-listItem:active {
  background-color: #003b4a;
}
